from enum import Enum, auto
class ReplayMode(Enum): 
    CONGRUENT = auto()   # value 1 # GP
    INCONGRUENT = auto() # value 2 # I
    HEADONLY = auto()    # value 3 # G
    NEUTRAL = auto()     # value 4 # P
    END = auto()         # value 5 

def blend(postures1,postures2):
    fractions = np.linspace(0,1,len(postures1))
    return [ list(posture1 * (1-fraction) + posture2 * fraction) for fraction, posture1, posture2 in zip(fractions, np.array(postures1), np.array(postures2)) ]

ready = False # in the start position

def prepare(nextid, mode=ReplayMode.CONGRUENT, duration=2.0):
    global ready
    dofs = right_arm_dofs
    postures = right_arm_trajectories[nextid]
    if mode.value != ReplayMode.HEADONLY.value:
        play_movement(todicts(dofs+right_fingers_dofs+left_arm_dofs,[postures[0]+right_fingers_pose+left_arm_pose]),[duration])
        ready = True
    play_movement(todicts(head_dofs,[head_default_pose]),[0.5])
    time.sleep(1)

contraid = 1   
def get_contraid(id):
    global contraid
    contraids = contras[id]
    contraid = contraids[np.random.randint(len(contraids))]
    return contraid
 
def replay_forward(id, mode=ReplayMode.CONGRUENT, percentage=100, duration=2.0, cm=4.5): #3, 6 is too much, 4.5 is ok
    dofs = right_arm_dofs
    postures = right_arm_trajectories[id]
    
    if mode.value == ReplayMode.INCONGRUENT.value:
        head_posture = list((np.array(head_congruent_poses[contraid])*cm + np.array(head_congruent_poses[id])*(9-cm))/9)
    elif mode.value == ReplayMode.NEUTRAL.value:
        head_posture = head_incongruent_pose
    else:
        head_posture = head_congruent_poses[id]
    
    perc = percentage/100.0
    if percentage < 100:
        postures = postures[:int(len(postures)*perc)]

    if mode.value == ReplayMode.HEADONLY.value:
        if ready:
            park()
            time.sleep(0.5)
    
    play_movement(todicts(head_dofs,[head_posture]),[0.5])

    n = len(postures)
    durations = [duration*perc/n]*n if n>0 else []
    
    if mode.value != ReplayMode.HEADONLY.value:
        if not ready:
            play_movement(todicts(dofs+right_fingers_dofs+left_arm_dofs,[postures[0]+right_fingers_pose+left_arm_pose]),[duration])
        if blind:
            blind_play_movement(todicts(dofs,postures),durations)
        else:
            play_movement(todicts(dofs,postures),durations)
    else:
        time.sleep(0.75)
   
def replay_backward(id, nextid=-1, mode=ReplayMode.CONGRUENT, percentage=100, duration=2.0):
    global ready
    dofs = right_arm_dofs
    postures = right_arm_trajectories[id]
    
    #if mode.value == ReplayMode.INCONGRUENT.value:
    #    head_posture = head_congruent_poses[contraid]
    #elif mode.value == ReplayMode.NEUTRAL.value:
    #    head_posture = head_incongruent_pose
    #else:
    #    head_posture = head_congruent_poses[id]
    head_posture = head_default_pose
    
    if nextid >= 0:
        next_postures = right_arm_trajectories[nextid]
    else:
        next_postures = np.copy(postures)

    perc = percentage/100.0
    if percentage < 100:
        postures = postures[:int(len(postures)*perc)]
        next_postures = next_postures[:int(len(next_postures)*perc)]

    play_movement(todicts(head_dofs,[head_posture]),[0.5])

    n = len(postures)
    durations = [duration/n]*n if n > 0 else []
    
    if mode.value == ReplayMode.HEADONLY.value:
        ready = False
    else:
        if blind:
            blind_play_movement(todicts(dofs,blend(postures[::-1],next_postures[::-1])),durations)
        else:
            play_movement(todicts(dofs,blend(postures[::-1],next_postures[::-1])),durations)
        ready = True

    time.sleep(1)

def relax():
    global ready
    park()
    ready = False
    time.sleep(2)

